import React, { useEffect, useState } from 'react';
import Review from "./Review";

const Home = () => {
    const [reviews, setReviews] = useState([]);

    useEffect(() => {
        fetch('https://script.google.com/macros/s/AKfycbzAk3DWTrYtZwCKKtrGhAtc1Au70cV_bxIoTMv8JbK_mv6lFH1ZUPPcJymtE6F8KjJF/exec')
            .then(res => {
                return res.json();
            })
            .then(data => setReviews(data))
    }, []);

    return (
        <div className="home">
            <div className="section">
                <h1>Top Reviews</h1>
                <div className="gallery">
                    {reviews.length > 0 && (<Review thing={reviews[0]} />)}
                </div>
            </div>
            <hr />
        </div>
    );
}

export default Home;
